import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function App() {
    return(
        <div>
            <div className='book'>
                <div className='title'>
                    My Title
                </div>
            </div>
        </div>
    )
}

ReactDOM.render(<App/>, document.getElementById('root'));
